class he_alarm:

    def __init__(self, sp=1.21, almc1=1.1, alm_step=0.12, almc2=1.15):
        self.sp = sp
        self.almc1 = almc1
        self.alm_step = alm_step
        self.almc2 = almc2
        self.__speedBuffer = [0.3 for i in range(10)]
        self.status = 0
        self.time = time.time()
        self.thre1 = self.almc1*self.sp
        self.thre2 = self.almc2*self.sp
        self.threk = self.alm_step*self.sp

    def alarm_ctl(self,x):  #return alm_signal
        x = abs(x)
        for i in range(len(self.__speedBuffer)-2,-1,-1):
            self.__speedBuffer[i+1] = self.__speedBuffer[i]
        self.__speedBuffer[0] = x
        k = (sum(self.__speedBuffer[0:3])-sum(self.__speedBuffer[3:6]))/3
        t = time.time()
        n_alm = self.neural_alm(self.__speedBuffer)


        if (self.status==2) and (n_alm == False):
            self.time = self.time - 0.2
        #1
        if ((self.status == 0)) and (x<=self.sp):
            self.status = 0
            return False
        #2
        if (self.status == 0) and (x>self.thre1):
            self.status = 1
            return False
        #3
        if (self.status == 1) and (x<=self.thre1):
            self.status = 0
            return False
        #4
        if (self.status == 1) and (x>self.thre1) and (x<=self.thre2) and (k<=self.threk) and (n_alm==False):
            self.status = 1
            return False
        #5
        if (self.status == 1) and ((k>self.threk) and (x>self.thre1)) or (x>self.thre2) or ((x>self.thre1) and (n_alm==True)):
            self.status = 2
            self.time = time.time()
            return True
        #6
        if (self.status == 2) and ((t-self.time)>2) and (x<=self.thre2) and (x>self.thre1):
            self.status = 1
            return False
        #7
        if (self.status == 2) and (t-self.time<=2):
            self.status =2
            return True
        #8
        if (self.status == 2) and (t-self.time>2) and (x>self.thre2):
            self.status = 2
            self.time = time.time()
            return True
        #9
        if (self.status == 2) and (t-self.time>2) and (x<=self.thre1):
            self.status = 0
            return False
        self.status = 0
        return False
    
    #@staticmethod
    def neural_alm(self,x):
        if len(x) != 10:   # crush no alert
            return False

        x = np.array(x)
        pre = np.dot(x,fc0_w)+fc0_b
        pre = relu(pre)
        pre = np.dot(pre,fc1_w)+fc1_b
        pre = relu(pre)
        pre = np.dot(pre,fc2_w)+fc2_b
        pre = relu(pre)
        pre = np.dot(pre,fc3_w)+fc3_b
        pre = relu(pre)
        pre = np.dot(pre,fc4_w)+fc4_b
        pre = np.dot(pre,fc5_w)+fc5_b
        pre = relu(pre)
        pre = np.dot(pre,fc6_w)+fc6_b
        score = relu(pre)
        pred = sigmoid(score)
        if pred[0]<pred[1]:
            return True
        else:
            return False
    
def relu(x):
    return np.maximum(0,x)
    
def sigmoid(x):
    s = 1 / (1 + np.exp(-x))
    return s
    

